export default app=>{app.component("carousel-indicators",{props:["count","id"],template:`<div class="carousel-indicators">\n        <button \n            v-for="n in count" \n            :key="n" \n            type="button" \n            :data-bs-target="'#' + id" \n            :data-bs-slide-to="n - 1" \n            :class="{ active: n === 1 }" \n            :aria-current="n === 1 ? 'true' : null"\n            :aria-label="'Slide ' + n">\n        </button>\n    </div>`})};